   public Printer()
   {
      motor = new Motor(70, 70);
   }
   
   public void Print()
   {
      motor.ReturnCarriage();
      motor.Right(50);
      motor.LoadPaper();
      
      for(int i = 0; i < image.length; i++)
      {
         for(int j = 0; j < image[0].length; j++)
         {
            if(image[i][j] == 1)
            {
               motor.PenDown();
               motor.PenUp();
               motor.Stop();
            }
            
            motor.Right(5);
            motor.Stop();
         }
         motor.ReturnCarriage();
         motor.Right(50);
         motor.Down(8);
         motor.Stop();
      }
   }
